function Logs(){
    let logName = "2022-08-09-105303.log"
    let logDir = "../../logs/"

    const reader = new FileReader();
    reader.onload = (e) =>{
        const logFile = (e.target.result);
    }
    const result = reader.readAsText(logFile)
    return(
        <div className="Logs">
            <p>Result {reader.result}</p>
        </div>
    );
}

